A channel is encoded as channel_encoding, defined as: rlp_batches = []
for batch in batches: rlp_batches.append(batch)
channel_encoding = compress(rlp_batches) where: batches is the input, a sequence of batches byte-encoded as per the next section ("Batch Encoding") rlp_batches is the concatenation of the RLP-encoded batches compress is a function performing compression, using the ZLIB algorithm (as specified in RFC-1950 ) with no dictionary channel_encoding is the compressed version of rlp_batches When decompressing a channel, we limit the amount of decompressed data to MAX_RLP_BYTES_PER_CHANNEL (currently 10,000,000 bytes), in order to avoid "zip-bomb" types of attack (where a small compressed input decompresses to a humongous amount of data). If the decompressed data exceeds the limit, things proceeds as though the channel contained only the first MAX_RLP_BYTES_PER_CHANNEL decompressed bytes. The limit is set on RLP decoding, so all batches that can be decoded in MAX_RLP_BYTES_PER_CHANNEL will be accepted even if the size of the channel is greater than MAX_RLP_BYTES_PER_CHANNEL. The exact requirement is that length(input) <= MAX_RLP_BYTES_PER_CHANNEL. While the above pseudocode implies that all batches are known in advance, it is possible to perform streaming compression and decompression of RLP-encoded batches. This means it is possible to start including channel frames in a batcher transaction before we know how many batches (and how many frames) the channel will contain.

